import React from "react";
import './cssBody/mainNav.css';

function MainNav(){
    return(
        <div className="head">
            <nav>
                <a href="/credit">Кредиты</a>
                <a href="">Вклады</a>
                <a href="/" className="logo">ВАШ.БАНК</a>
                <a href="">Ипотека</a>
                <a href="">Поддержка</a>
            </nav>
        </div>
    )
}

export default MainNav;
